import React  from 'react';

const Button = (props) =>{
    const{
        type,
        onClick,
        label,
        disabled
      }=props
        

  return(
      <div
      className={`btn btn-${type}`}
      isDisabled={`${disabled}`}
      onClick={(e)=>{
          
          onClick(e)
      }}
      >
      {label}

      </div>
  )
}

Button.defaultProps ={
type:'primary',
disabled:'false'
} 

export default Button;
